var fs = require('fs');

/* FUNCTION DEFINITIONS */
function getImageMimeTypeFromBase64(base64Data) {
    return base64Data.substring("data:image/".length, base64Data.indexOf(";base64"))
}

function decodeBase64Image(dataString) {
    var matches = dataString.match(/^data:([A-Za-z-+\/]+);base64,(.+)$/),
        response = {};

    if (matches.length !== 3) {
        return new Error('Invalid input string');
    }

    response.type = matches[1];

    var stringLength = dataString.length - 'data:image/png;base64,'.length;
    var sizeInBytes = 4 * Math.ceil((stringLength / 3)) * 0.5624896334383812;

    response.data = new Buffer.alloc(sizeInBytes, matches[2], 'base64');

    return response;
}

function base64ToImage(data) {
    var fileName = 'sample' + '.' + data.imageMimeType;

    fs.writeFile(fileName, data.imageBuffer.data, function (err) {
        if (err) throw err
        else {
            console.log(fileName + ' written successfully');
        }
    })
}


/* CODE START */

var imgObj = {
    base64: 'data:image/jpeg;base64,'
}


var imageMimeType = getImageMimeTypeFromBase64(imgObj.base64);

var data = {
    imageBuffer: decodeBase64Image(imgObj.base64),
    imageMimeType: imageMimeType,
}

base64ToImage(data)

